export type AxiePartIconType = 'eye' | 'ears';

interface AxiePartIconProps extends IconProps {
  type: AxiePartIconType;
}

export const AxiePartIcon = ({ type, ...rest }: AxiePartIconProps): JSX.Element => {
  const icons = {
    eyes: EyesIcon,
    ears: EarsIcon,
    mouth: MouthIcon,
    horn: HornIcon,
    back: BackIcon,
    tail: TailIcon,
  };

  return <Icon as={icons[type]} {...rest} />;
};
